import React, { useState } from "react";
import "../css/hover-menu-items-shape.css";
import { ShapeSquare } from "./ShapeSquare";
export const HoverMenuItems_Shapes = () => {
  const [drawing, setDrawing] = useState(false);

  const shapes = [
    { name: "Arrow", img: "", whatItDoes: () => {} },
    { name: "Rectangle", img: "", whatItDoes: () => {} },
    { name: "Line", img: "", whatItDoes: () => {} },
    { name: "Circle", img: "", whatItDoes: () => {} },
    { name: "DashedLine", img: "", whatItDoes: () => {} },
    { name: "DashedRectangle", img: "", whatItDoes: () => {} },
    { name: "DashedLine", img: "", whatItDoes: () => {} },
    { name: "DashedCircle", img: "", whatItDoes: () => {} },
  ];
  return (
    <div className="container">
      {shapes.map((item, _) => (
        <ButtonComponent>{item.name}</ButtonComponent>
      ))}
    </div>
  );
};

const ButtonComponent = (img, name, event) => {
  return (
    <>
      <button></button>
    </>
  );
};
